import StudentData from "./studentData.js";
import StudentForm from "./StudentForm1.js";
import StudentEditForm from "./StudentFormEdit.js";
// import Registration from "./Registration.js";
// import Login from "./LoginForm.js";
import { BrowserRouter as Routers,Routes,Route} from "react-router-dom";
function App(){
    return(
        <Routers>
            {/* <h1>Student Registration Gtyde technology</h1> */}
            <Routes>
            {/* <Route path="/" element={<Registration/>}/> */}
            {/* <Route path="/Login" element={<Login/>}/> */}
            <Route path="/a" element={<StudentData/>}/>
            <Route path="/StudentForm1" element={<StudentForm/>}/>
            <Route path="/studenteditLogin/:stid" element={<StudentEditForm/>}/>
            {/* <Route path="/Registration" element={<Registration/>}/> */}
            </Routes>
        </Routers>
    )
}
export default App;
